import { makeStyles } from "@material-ui/core/styles";
import { themes } from '../../themes/ColorPalette';

export default makeStyles(() => ({
    container:{
        backgroundColor: themes.palette.secondary.dark,
        justifyContent:'space-between',
        display: 'fixed',
        padding: '10px',
        flexDirection: 'row',
        height:'100vh',
    },
    typography:{
        color: themes.palette.secondary.light,
        fontWeight: 'lighter',
        marginTop: 0,
    },
    }
))
